import React from 'react';
import TitleBar from '../../components/TitleBar/TitleBar';

const Info = (props) => {
    return(
        <div>
            <TitleBar>INFORMACJA</TitleBar>

    <p>{props.location.infoProp.info}</p>
        </div>
    )
}

export default Info;
